import React from "react";
import { Container, Title, Wrap } from "./styled";
import { Cards } from "src/pages/Companies/CompanyCard/cards";
import CompanyCard from "src/pages/Companies/CompanyCard/CompanyCard";
import { Link, useParams } from "react-router-dom";

export default function Companies() {
  const { id } = useParams()

  const cards = Cards.map((card) => (
    <Link to="/companies/:id">
      <CompanyCard key={card.id} imgUrl={card.imgUrl} title={card.title} />
    </Link>
  ));

  return (
    <Wrap>
      <Title>Здоровье</Title>
      <Container>{cards}</Container>
    </Wrap>
  );
}
